June 26th is the first anniversary of Hu Xijin's stock market account opening. Sina Securities sorted out Hu Xijin's stock trading events based on Hu Xijin's stock trading diary:
On June 26, 2023, he opened a stock account and invested 200,000 yuan.
On July 31, 2023, Hu Xijin's floating profit exceeded 10,000 yuan;
On August 17, 2023, Hu Xijin increased his capital and the stock account funds reached 300,000 yuan;
On August 23, 2023, he used up 300,000 yuan of funds and filled his warehouse;
